import styled from 'styled-components';

export const ResultListWrapper = styled.div`
  font-size: 20px;
  padding-bottom: 100px;
  align: center;
`;

export const Title = styled.p`
  color: white;
  font-size: 40px;
`
export const Term = styled(Title)`
  color: grey;
`

export const TitleWrapper = styled.div`
  padding-top: 20px;
  text-align: center;
`
